import React, {Fragment, ReactFragment} from 'react';

export default function Header(){
	const [state, setState] = React.useState({});


	return(
		<>
			<header className={'Header'}>
				<div className={'mainLineHeader'}>
					<div className={'logo'}>123</div>
					<nav className={'navigation'}>
						<ul className={'list-group'}>
							<li className={'nav-link'}><a href="default.asp">GitHub</a></li>
							<li className={'nav-link'}><a href="default.asp">HH</a></li>
							<li className={'nav-link'}><a href="default.asp">Leetcode</a></li>
						</ul>
					</nav>
				</div>
			</header>
		</>
	);

}
